import React from 'react';
import { ProjectsContainer, Title, ProjectsWrapper, Project, ProjectImage, ProjectDescription, ProjectTitle,
         Description,Links, Link  } from './ExampleElements';

const Example = () => {
  return (
      <ProjectsContainer id='projects'>
          <Title>
              Projects
          </Title>
          <ProjectsWrapper>
              <Project>
              <ProjectImage src={img} alt={alt} />
                  <ProjectDescription>
                      <ProjectTitle>
                          {title}
                      </ProjectTitle>
                      <Description>
                          {description}
                      </Description>
                      <Links>
                      <Link href={githubLink} />                          
                      <Link  href={projectLink}/>
                      </Links>
                  </ProjectDescription>
              </Project>
          </ProjectsWrapper>
      </ProjectsContainer>
  );
};

export default Example;
